"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[2994],{2799:(e,t,r)=>{r.r(t),r.d(t,{data:()=>s});const s={key:"v-369295b4",path:"/service/sid/",title:"学号（SID）",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[{level:2,title:"学号的含义",slug:"学号的含义",children:[]}],filePathRelative:"service/sid/README.md",git:{createdTime:1596618035e3,updatedTime:1626484504e3,contributors:[{name:"elantrean",email:"elantreanfu@gmail.com",commits:2},{name:"Ryyyc",email:"47767371+Ryyyc@users.noreply.github.com",commits:1},{name:"liziwl",email:"leezisy@gmail.com",commits:1},{name:"sparkcyf",email:"sparktour@outlook.com",commits:1}]}}},8872:(e,t,r)=>{r.r(t),r.d(t,{default:()=>a});const s=(0,r(6252).uE)('<h1 id="学号-sid" tabindex="-1"><a class="header-anchor" href="#学号-sid" aria-hidden="true">#</a> 学号（SID）</h1><h2 id="学号的含义" tabindex="-1"><a class="header-anchor" href="#学号的含义" aria-hidden="true">#</a> 学号的含义</h2><p>例：一个典型的本科生学号<strong>12012345</strong>，共有八位：</p><p><strong>1：</strong> 第一位为身份，1代表学生，3代表雇员。</p><p><strong>20：</strong> 第二、三位为入学年份，<strong>20</strong>代表20年入学。</p><p><strong>1：</strong> 第四位为学生修学的学位，<strong>1</strong>代表本科生（不含国际生）。</p><p><strong>23：</strong> 第五、六位为班级编号，<strong>23</strong>代表这位同学在23行政班，不同的班级归属于不同的书院，所以可以从班级编号判断出书院。</p><p><strong>45：</strong> 第七、八为学生在班内的序号，<strong>45</strong>代表这位同学在班级内的序列号为45。（实际上一个行政班不会有这么多人）</p>',8),n={},a=(0,r(3744).Z)(n,[["render",function(e,t){return s}]])}}]);